import React, { Component } from 'react'
import AdditionalUser from './AdditionalUser'

export class AdditionalUsers extends Component {

    list = () => {
        let arr = [];
        for (let i = 1; i < this.props.users.length; i++) {
            arr.push(<AdditionalUser firstName={this.props.users[i].firstName} lastName={this.props.users[i].lastName}/>)
        }
        return arr; 
    }


    additionalUserList = () => {
        return this.props.users.filter(user => {return !this.props.users.active})
    }


    render() {
        return (
            <div>
                <div id="additional-users-label">Additional Users</div>
                        <div className="additional-users">
                            <ul className="user-list">

                            {this.additionalUserlist()}




                            </ul>
                        </div>
            </div>
        )
    }
}

export default AdditionalUsers
